import React from "react";
import {
  interaction,
  layer,
  custom,
  control, //name spaces
  Interactions,
  Overlays,
  Controls, //group
  Map,
  Layers,
  Overlay,
  Util, //objects
} from "react-openlayers";
import * as ol from "openlayers";

import { Box } from "grommet";

const MapBox = () => {
  return (
    <Box fill margin="small">
      <Map>
        <Layers>
          <layer.Tile source={new ol.source.OSM()} />
        </Layers>
        <Controls></Controls>
        <Interactions></Interactions>
        <Overlays></Overlays>
      </Map>
    </Box>
  );
};

export default MapBox;
